class Solution {
    public List<Integer> factorize(int n) {
        List<Integer> factors = new ArrayList<>();
        int i = 2;
        while (i <= Math.sqrt(n)) {
            while (n % i == 0) {
                factors.add(i);
                n /= i;
            }
            i++;
        }
        if (n > 1) {
            factors.add(n);
        }
        return factors;
    }
}

