class Solution {
    public int how_many_times(String string, String substring) {
        int times = 0;
        int substringLength = substring.length();
        int stringLength = string.length();

        for (int i = 0; i <= stringLength - substringLength; i++) {
            if (string.substring(i, i + substringLength).equals(substring)) {
                times++;
            }
        }

        return times;
    }
}

