class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        List<Double> closestPair = new ArrayList<>();
        Double distance = null;

        for (int i = 0; i < numbers.size(); i++) {
            for (int j = 0; j < numbers.size(); j++) {
                if (i != j) {
                    double newDistance = Math.abs(numbers.get(i) - numbers.get(j));
                    if (distance == null || newDistance < distance) {
                        distance = newDistance;
                        closestPair.clear();
                        closestPair.add(Math.min(numbers.get(i), numbers.get(j)));
                        closestPair.add(Math.max(numbers.get(i), numbers.get(j)));
                    }
                }
            }
        }
        return closestPair;
    }
}

