class Solution {
    public List<Integer> sort_third(List<Integer> l) {
        List<Integer> result = new ArrayList<>(l); // Create a copy of the original list
        List<Integer> thirdIndices = new ArrayList<>(); // List to hold values at indices divisible by 3

        // Collect values at indices divisible by 3
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                thirdIndices.add(l.get(i));
            }
        }

        // Sort the collected values
        Collections.sort(thirdIndices);

        // Place sorted values back into the result list at the appropriate indices
        for (int i = 0; i < result.size(); i++) {
            if (i % 3 == 0) {
                result.set(i, thirdIndices.get(i / 3)); // Set sorted value at index i
            }
        }

        return result; // Return the modified list
    }
}

