class Solution {
    public List<Integer> sort_even(List<Integer> l) {
        List<Integer> evens = new ArrayList<>();
        List<Integer> odds = new ArrayList<>();

        // Separate even and odd indexed elements
        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                evens.add(l.get(i));
            } else {
                odds.add(l.get(i));
            }
        }

        // Sort the even indexed elements
        Collections.sort(evens);

        List<Integer> ans = new ArrayList<>();
        int evenSize = evens.size();
        int oddSize = odds.size();

        // Combine sorted evens and original odds
        for (int i = 0; i < Math.min(evenSize, oddSize); i++) {
            ans.add(evens.get(i));
            ans.add(odds.get(i));
        }

        // If there is an extra even element, add it to the result
        if (evenSize > oddSize) {
            ans.add(evens.get(evenSize - 1));
        }

        return ans;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_even(new ArrayList<>(Arrays.asList(1, 2, 3))).equals(Arrays.asList(1, 2, 3)),
                s.sort_even(new ArrayList<>(Arrays.asList(5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10))).equals(Arrays.asList(-10, 3, -5, 2, -3, 3, 5, 0, 9, 1, 123)),
                s.sort_even(new ArrayList<>(Arrays.asList(5, 8, -12, 4, 23, 2, 3, 11, 12, -10))).equals(Arrays.asList(-12, 8, 3, 4, 5, 2, 12, 11, 23, -10))
        );
        if (correct.contains(false)) {
