class Solution {
    public String change_base(int x, int base) {
        StringBuilder ret = new StringBuilder();
        while (x > 0) {
            ret.insert(0, x % base); // Prepend the digit to the result
            x /= base; // Reduce x for the next iteration
        }
        return ret.toString(); // Convert StringBuilder to String and return
    }
}

