class Solution {
    public int fib4(int n) {
        int[] results = new int[Math.max(n + 1, 4)];
        results[0] = 0;
        results[1] = 0;
        results[2] = 2;
        results[3] = 0;

        if (n < 4) {
            return results[n];
        }

        for (int i = 4; i <= n; i++) {
            results[i] = results[i - 1] + results[i - 2] + results[i - 3] + results[i - 4];
        }

        return results[n];
    }
}

