class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        if (arr.isEmpty()) {
            return new ArrayList<>();
        }

        int minEven = Integer.MAX_VALUE;
        int minIndex = -1;
        boolean foundEven = false;

        for (int i = 0; i < arr.size(); i++) {
            if (arr.get(i) % 2 == 0) {
                foundEven = true;
                if (arr.get(i) < minEven) {
                    minEven = arr.get(i);
                    minIndex = i;
                }
            }
        }

        if (!foundEven) {
            return new ArrayList<>();
        }

        List<Integer> result = new ArrayList<>();
        result.add(minEven);
        result.add(minIndex);
        return result;
    }
}

