class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the sum of elements exceeds the maximum weight
        int sum = 0;
        for (int num : q) {
            sum += num;
        }
        if (sum > w) {
            return false;
        }

        // Check if the list is palindromic
        int i = 0;
        int j = q.size() - 1;
        while (i < j) {
            if (!q.get(i).equals(q.get(j))) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }
}

