class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> res = new ArrayList<>();
        boolean switchFlag = true;

        while (!lst.isEmpty()) {
            if (switchFlag) {
                Integer minValue = Collections.min(lst);
                res.add(minValue);
                lst.remove(minValue);
            } else {
                Integer maxValue = Collections.max(lst);
                res.add(maxValue);
                lst.remove(maxValue);
            }
            switchFlag = !switchFlag; // Toggle the switch
        }
        return res;
    }
}

