class Solution {
    // Helper function to check if a number is prime
    public boolean isPrime(int n) {
        if (n < 2) return false;
        for (int j = 2; j * j <= n; j++) { // Optimize by checking up to the square root of n
            if (n % j == 0) {
                return false;
            }
        }
        return true;
    }

    public boolean is_multiply_prime(int a) {
        // Check for combinations of three prime numbers
        for (int i = 2; i < 100; i++) {
            if (!isPrime(i)) continue;
            for (int j = 2; j < 100; j++) {
                if (!isPrime(j)) continue;
                for (int k = 2; k < 100; k++) {
                    if (!isPrime(k)) continue;
                    if (i * j * k == a) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
