class Solution {
    public int hex_key(String num) {
        char[] primes = {'2', '3', '5', '7', 'B', 'D'};
        int total = 0;
        for (int i = 0; i < num.length(); i++) {
            for (char prime : primes) {
                if (num.charAt(i) == prime) {
                    total++;
                    break; // Break to avoid counting the same prime multiple times
                }
            }
        }
        return total;
    }
}

