class Solution {
    public boolean check_dict_case(Map<Object, Object> dict) {
        if (dict.isEmpty()) {
            return false;
        } else {
            String state = "start";
            for (Object key : dict.keySet()) {
                if (!(key instanceof String)) {
                    state = "mixed";
                    break;
                }
                String strKey = (String) key;
                if (state.equals("start")) {
                    if (strKey.equals(strKey.toUpperCase())) {
                        state = "upper";
                    } else if (strKey.equals(strKey.toLowerCase())) {
                        state = "lower";
                    } else {
                        break;
                    }
                } else if ((state.equals("upper") && !strKey.equals(strKey.toUpperCase())) ||
                           (state.equals("lower") && !strKey.equals(strKey.toLowerCase()))) {
                    state = "mixed";
                    break;
                }
            }
            return state.equals("upper") || state.equals("lower");
        }
    }
}

