class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> coords = new ArrayList<>();

        // Finding coordinates of x in the nested list
        for (int i = 0; i < lst.size(); i++) {
            for (int j = 0; j < lst.get(i).size(); j++) {
                if (lst.get(i).get(j) == x) {
                    List<Integer> coord = new ArrayList<>();
                    coord.add(i);
                    coord.add(j);
                    coords.add(coord);
                }
            }
        }

        // Sorting by row (ascending) and then by column (descending)
        coords.sort(Comparator.comparingInt(a -> a.get(0))); // Sort by row
        coords.sort((a, b) -> b.get(1).compareTo(a.get(1))); // Sort by column in descending order

        return coords;
    }
}

