class Solution {
    public String encrypt(String s) {
        String d = "abcdefghijklmnopqrstuvwxyz";
        StringBuilder out = new StringBuilder();

        for (char c : s.toCharArray()) {
            if (d.indexOf(c) != -1) {
                int newIndex = (d.indexOf(c) + 4) % 26; // Shift by 4 (2*2)
                out.append(d.charAt(newIndex));
            } else {
                out.append(c); // Append non-alphabet characters unchanged
            }
        }

        return out.toString();
    }
}

