class Solution {
    public List<Integer> sort_array(List<Integer> array) {
        if (array.isEmpty()) {
            return new ArrayList<>(); // Return an empty list if the input is empty
        }

        // Calculate the sum of the first and last elements
        int sum = array.get(0) + array.get(array.size() - 1);

        // Create a copy of the original array to sort
        List<Integer> sortedArray = new ArrayList<>(array);

        // Sort in ascending or descending order based on the sum
        if (sum % 2 == 0) {
            Collections.sort(sortedArray, Collections.reverseOrder()); // Sort in descending order
        } else {
            Collections.sort(sortedArray); // Sort in ascending order
        }

        return sortedArray; // Return the sorted copy
    }
}

