class Solution {
    public int closest_integer(String value) {
        // Remove trailing zeros if the value contains a decimal point
        if (value.contains(".")) {
            value = value.replaceAll("0*$", "").replaceAll("\\.$", "");
        }

        double num = Double.parseDouble(value);
        int res;

        // Check if the number is equidistant from two integers
        if (value.endsWith(".5")) {
            if (num > 0) {
                res = (int) Math.ceil(num);
            } else {
                res = (int) Math.floor(num);
            }
        } else {
            res = (int) Math.round(num);
        }

        return res;
    }
}

