class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            if (digitsSum(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int digitsSum(int n) {
        int sum = 0;
        boolean isNegative = n < 0;
        n = Math.abs(n);
        String numStr = Integer.toString(n);

        for (int i = 0; i < numStr.length(); i++) {
            int digit = Character.getNumericValue(numStr.charAt(i));
            if (i == 0 && isNegative) {
                sum -= digit; // First digit is negative
            } else {
                sum += digit; // Add other digits normally
            }
        }
        return sum;
    }
}

