class Solution {
    public Map<String,Integer> histogram(String test) {
        Map<String, Integer> result = new HashMap<>();
        String[] letters = test.split(" ");
        int maxCount = 0;

        // Find the maximum count of occurrences
        for (String letter : letters) {
            if (!letter.isEmpty()) {
                int count = Collections.frequency(Arrays.asList(letters), letter);
                if (count > maxCount) {
                    maxCount = count;
                }
            }
        }

        // Populate the result map with letters that have the maximum count
        for (String letter : letters) {
            if (!letter.isEmpty()) {
                int count = Collections.frequency(Arrays.asList(letters), letter);
                if (count == maxCount) {
                    result.put(letter, count);
                }
            }
        }

        return result;
    }
}

