class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int oddCount = 0;
        int evenCount = 0;

        // Count odd numbers in lst1
        for (int num : lst1) {
            if (num % 2 == 1) {
                oddCount++;
            }
        }

        // Count even numbers in lst2
        for (int num : lst2) {
            if (num % 2 == 0) {
                evenCount++;
            }
        }

        // Check if there are enough even numbers to replace all odd numbers
        if (evenCount >= oddCount) {
            return "YES";
        }
        return "NO";
    }
}

