class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true; // An empty array is trivially sorted
        }

        List<Integer> sortedArray = new ArrayList<>(arr);
        Collections.sort(sortedArray); // Create a sorted version of the array

        int minValue = Collections.min(arr); // Find the minimum value in the array
        int minIndex = arr.indexOf(minValue); // Get the index of the minimum value

        // Create a new array simulating the right shifts
        List<Integer> myArr = new ArrayList<>();
        for (int i = minIndex; i < arr.size(); i++) {
            myArr.add(arr.get(i)); // Add elements from minIndex to the end
        }
        for (int i = 0; i < minIndex; i++) {
            myArr.add(arr.get(i)); // Add elements from the start to minIndex
        }

        // Compare the newly arranged array with the sorted array
        for (int i = 0; i < arr.size(); i++) {
            if (!myArr.get(i).equals(sortedArray.get(i))) {
                return false; // If any element does not match, return false
            }
        }

        return true; // All elements match, return true
    }
}

