class Solution {
    public int minSubArraySum(List<Integer> nums) {
        int maxSum = 0;
        int s = 0;

        for (int num : nums) {
            s += -num;
            if (s < 0) {
                s = 0;
            }
            maxSum = Math.max(s, maxSum);
        }

        if (maxSum == 0) {
            for (int num : nums) {
                maxSum = Math.max(maxSum, -num);
            }
        }

        return -maxSum;
    }
}

