class Solution {
    public List<Integer> get_odd_collatz(int n) {
        List<Integer> oddCollatz = new ArrayList<>();

        if (n % 2 == 1) {
            oddCollatz.add(n);
        }

        while (n > 1) {
            if (n % 2 == 0) {
                n = n / 2;
            } else {
                n = n * 3 + 1;
            }

            if (n % 2 == 1) {
                oddCollatz.add(n);
            }
        }

        Collections.sort(oddCollatz);
        return oddCollatz;
    }
}

