class Solution {
    public String match_parens(List<String> lst) {
        // Concatenate the strings in both possible orders
        String S1 = lst.get(0) + lst.get(1);
        String S2 = lst.get(1) + lst.get(0);

        // Check if either concatenated string is balanced
        return (check(S1) || check(S2)) ? "Yes" : "No";
    }

    // Helper function to check if a string of parentheses is balanced
    private boolean check(String s) {
        int val = 0;
        for (char ch : s.toCharArray()) {
            if (ch == '(') {
                val++;
            } else {
                val--;
            }
            if (val < 0) {
                return false; // More closing parentheses than opening ones
            }
        }
        return val == 0; // True if balanced, false otherwise
    }
}

