class Solution {
    public Object split_words(String txt) {
        // Check for whitespace
        if (txt.contains(" ")) {
            return Arrays.asList(txt.split("\\s+"));
        }
        // Check for commas
        else if (txt.contains(",")) {
            return Arrays.asList(txt.replace(",", " ").split("\\s+"));
