class Solution {
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int prod;
        if (arr.contains(0)) {
            prod = 0;
        } else {
            int negativeCount = 0;
            for (int num : arr) {
                if (num < 0) {
                    negativeCount++;
                }
            }
            prod = (negativeCount % 2 == 0) ? 1 : -1;
        }

        int sumOfMagnitudes = 0;
        for (int num : arr) {
            sumOfMagnitudes += Math.abs(num);
        }

        return Optional.of(prod * sumOfMagnitudes);
    }
}

