class Solution {
    public boolean is_sorted(List<Integer> lst) {
        Map<Integer, Integer> countDigit = new HashMap<>();

        // Count occurrences of each number
        for (Integer num : lst) {
            countDigit.put(num, countDigit.getOrDefault(num, 0) + 1);
        }

        // Check if any number appears more than twice
        for (Integer count : countDigit.values()) {
            if (count > 2) {
                return false;
            }
        }

        // Check if the list is sorted in ascending order
        for (int i = 1; i < lst.size(); i++) {
            if (lst.get(i - 1) > lst.get(i)) {
                return false;
            }
        }

        return true;
    }
}

