class Solution {
    /**
    Given a positive integer n, return the product of the odd digits.
    Return 0 if all digits are even.
    For example:
    digits(1)  == 1
    digits(4)  == 0
    digits(235) == 15
     */
    public int digits(int n) {
        int product = 1;
        int oddCount = 0;
        while (n > 0) {
            int digit = n % 10; // Get the last digit
            if (digit % 2 == 1) { // Check if the digit is odd
                product *= digit; // Multiply the product by the odd digit
                oddCount++; // Increment the count of odd digits
            }
            n /= 10; // Remove the last digit
        }
        return (oddCount == 0) ? 0 : product; // Return 0 if no odd digits, otherwise return the product
    }
}

