class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        List<Integer> result = new ArrayList<>();
        boolean[][] visited = new boolean[n][n];
        PriorityQueue<List<Integer>> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < Math.min(a.size(), b.size()); i++) {
                if (!a.get(i).equals(b.get(i))) {
                    return a.get(i) - b.get(i);
                }
            }
            return a.size() - b.size();
        });

        // Start from every cell in the grid
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                List<Integer> path = new ArrayList<>();
                dfs(grid, i, j, k, path, pq, visited);
            }
        }

        // Get the lexicographically smallest path of length k
        if (!pq.isEmpty()) {
            result = pq.poll();
        }
        return result;
    }

    private void dfs(List<List<Integer>> grid, int x, int y, int k, List<Integer> path, PriorityQueue<List<Integer>> pq, boolean[][] visited) {
        if (path.size() == k) {
            pq.offer(new ArrayList<>(path));
            return;
        }

        // Check boundaries
        if (x < 0 || x >= grid.size() || y < 0 || y >= grid.size() || visited[x][y]) {
            return;
        }

        // Mark the cell as visited
        visited[x][y] = true;
        path.add(grid.get(x).get(y));

        // Explore neighbors (up, down, left, right)
        dfs(grid, x - 1, y, k, path, pq, visited);
        dfs(grid, x + 1, y, k, path, pq, visited);
        dfs(grid, x, y - 1, k, path, pq, visited);
        dfs(grid, x, y + 1, k, path, pq, visited);

        // Backtrack
        visited[x][y] = false;
        path.remove(path.size() - 1);
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
