class Solution {
    public List<Integer> tri(int n) {
        List<Integer> myTri = new ArrayList<>();
        if (n == 0) {
            myTri.add(1);
            return myTri;
        }
        myTri.add(1); // tri(0)
        myTri.add(3); // tri(1)

        for (int i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                myTri.add(1 + i / 2);
            } else {
                int value = myTri.get(i - 1) + myTri.get(i - 2) + (i + 3) / 2;
                myTri.add(value);
            }
        }
        return myTri;
    }
}

