class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        String tempA = a.toString().replace(',', '.');
        String tempB = b.toString().replace(',', '.');

        double valueA = Double.parseDouble(tempA);
        double valueB = Double.parseDouble(tempB);

        if (valueA == valueB) {
