class Solution {
    public String fix_spaces(String text) {
        StringBuilder newText = new StringBuilder();
        int start = 0, end = 0;
        int length = text.length();

        while (end < length) {
            if (text.charAt(end) == ' ') {
                end++;
            } else {
                if (end - start > 2) {
                    newText.append('-').append(text.charAt(end));
                } else if (end - start > 0) {
                    for (int j = 0; j < end - start; j++) {
                        newText.append('_');
                    }
                    newText.append(text.charAt(end));
                } else {
                    newText.append(text.charAt(end));
                }
                start = end + 1;
                end++;
            }
        }

        if (end - start > 2) {
            newText.append('-');
        } else if (end - start > 0) {
            for (int j = 0; j < end - start; j++) {
                newText.append('_');
            }
        }

        return newText.toString();
    }
}

