class Solution {
    public String file_name_check(String file_name) {
        String[] validExtensions = {"txt", "exe", "dll"};
        String[] parts = file_name.split("\\.");

        // Check if there is exactly one dot
        if (parts.length != 2) {
            return "No";
        }

        // Check if the extension is valid
        String extension = parts[1];
        boolean isValidExtension = Arrays.asList(validExtensions).contains(extension);
        if (!isValidExtension) {
            return "No";
        }

        // Check if the name before the dot is not empty
        String nameBeforeDot = parts[0];
        if (nameBeforeDot.isEmpty()) {
            return "No";
        }

        // Check if the first character is a letter
        if (!Character.isLetter(nameBeforeDot.charAt(0))) {
            return "No";
        }

        // Count the number of digits in the name before the dot
        int digitCount = 0;
        for (char c : nameBeforeDot.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
            }
        }

        // Check if there are more than three digits
        if (digitCount > 3) {
            return "No";
        }

        // If all checks passed, return "Yes"
        return "Yes";
    }
}

