class Solution {
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst) {
        Integer largestNegative = null;
        Integer smallestPositive = null;

        for (Integer num : lst) {
            if (num < 0) {
                if (largestNegative == null || num > largestNegative) {
                    largestNegative = num;
                }
            } else if (num > 0) {
                if (smallestPositive == null || num < smallestPositive) {
                    smallestPositive = num;
                }
            }
        }

        return Arrays.asList(
            Optional.ofNullable(largestNegative),
            Optional.ofNullable(smallestPositive)
        );
    }
}

