class Solution {
    public int sum_squares(List<Integer> lst) {
        int sum = 0;
        for (int i = 0; i < lst.size(); i++) {
            if (i % 3 == 0) {
                sum += lst.get(i) * lst.get(i); // Square the element
            } else if (i % 4 == 0) {
                sum += lst.get(i) * lst.get(i) * lst.get(i); // Cube the element
            } else {
                sum += lst.get(i); // Keep the element unchanged
            }
        }
        return sum;
    }
}

