class Solution {
    public int get_max_triples(int n) {
        int[] A = new int[n];
        for (int i = 1; i <= n; i++) {
            A[i - 1] = i * i - i + 1; // Fill the array according to the formula
        }

        int count = 0;
        // Check all combinations of i, j, k where i < j < k
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                for (int k = j + 1; k < n; k++) {
                    if ((A[i] + A[j] + A[k]) % 3 == 0) {
                        count++; // Increment count for valid triples
                    }
                }
            }
        }
        return count; // Return the total count of valid triples
    }
}

