class Solution {
    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (int num : nums) {
            if (num > 10) {
                String numberAsString = String.valueOf(num);
                char firstDigit = numberAsString.charAt(0);
                char lastDigit = numberAsString.charAt(numberAsString.length() - 1);

                if (isOdd(firstDigit) && isOdd(lastDigit)) {
                    count++;
                }
            }
        }
        return count;
    }

    private boolean isOdd(char digit) {
        return digit == '1' || digit == '3' || digit == '5' || digit == '7' || digit == '9';
    }
}

