class Solution {
    public List<String> bf(String planet1, String planet2) {
        String[] planetNames = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

        // Check if planet1 or planet2 are valid and not the same
        if (!Arrays.asList(planetNames).contains(planet1) || 
            !Arrays.asList(planetNames).contains(planet2) || 
            planet1.equals(planet2)) {
            return new ArrayList<>();
        }

        int planet1Index = Arrays.asList(planetNames).indexOf(planet1);
        int planet2Index = Arrays.asList(planetNames).indexOf(planet2);

        List<String> result = new ArrayList<>();

        // Determine the range of planets to return
        if (planet1Index < planet2Index) {
            for (int i = planet1Index + 1; i < planet2Index; i++) {
                result.add(planetNames[i]);
            }
        } else {
            for (int i = planet2Index + 1; i < planet1Index; i++) {
                result.add(planetNames[i]);
            }
        }

        return result;
    }
}

