class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        // Create a comparator to sort based on the sum of digits
        Comparator<Integer> digitSumComparator = new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int sumA = digitSum(a);
                int sumB = digitSum(b);
                return Integer.compare(sumA, sumB);
            }
        };

        // Sort the list using the custom comparator
        List<Integer> sortedList = new ArrayList<>(nums);
        Collections.sort(sortedList, digitSumComparator);
        return sortedList;
    }

    // Helper method to calculate the sum of digits
    private int digitSum(int n) {
        int sum = 0;
        boolean isNegative = n < 0;
        n = Math.abs(n);

        // Calculate the sum of digits
        while (n > 0) {
            sum += n % 10;
            n /= 10;
        }

        // Adjust the first digit if the number was negative
        if (isNegative) {
            sum += -1; // Adjust for the negative sign
        }

        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.order_by_points(new ArrayList<>(Arrays.asList(1, 11, -1, -11, -12))).equals(Arrays.asList(-1, -11, 1, -12, 11)),
                s.order_by_points(new ArrayList<>(Arrays.asList(1234, 423, 463, 145, 2, 423, 423, 53, 6, 37, 3457, 3, 56, 0, 46))).equals(Arrays.asList(0, 2, 3, 6, 53, 423, 423, 423, 1234, 145, 37, 46, 56, 463, 3457)),
