class Solution {
    public List<Integer> even_odd_count(int num) {
        int evenCount = 0;
        int oddCount = 0;
        String numStr = Integer.toString(Math.abs(num)); // Convert to absolute value and then to string

        for (char digit : numStr.toCharArray()) {
            int digitValue = Character.getNumericValue(digit); // Convert character back to integer
            if (digitValue % 2 == 0) {
                evenCount++;
            } else {
                oddCount++;
            }
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);
        return result; // Return the list containing even and odd counts
    }
}

