class Solution {
    public String Strongest_Extension(String class_name, List<String> extensions) {
        String strongest = extensions.get(0);
        int maxStrength = countUppercase(strongest) - countLowercase(strongest);

        for (String extension : extensions) {
            int currentStrength = countUppercase(extension) - countLowercase(extension);
            if (currentStrength > maxStrength) {
                strongest = extension;
                maxStrength = currentStrength;
            }
        }

        return class_name + "." + strongest;
    }

    private int countUppercase(String s) {
        int count = 0;
        for (char c : s.toCharArray()) {
            if (Character.isUpperCase(c)) {
                count++;
            }
        }
        return count;
    }

    private int countLowercase(String s) {
        int count = 0;
        for (char c : s.toCharArray()) {
            if (Character.isLowerCase(c)) {
                count++;
            }
        }
        return count;
    }
}

