class Solution {
    public List<String> sorted_list_sum(List<String> lst) {
        // Sort the list alphabetically
        Collections.sort(lst);

        // Create a new list to hold strings with even lengths
        List<String> new_lst = new ArrayList<>();

        // Filter out strings with odd lengths
        for (String str : lst) {
            if (str.length() % 2 == 0) {
                new_lst.add(str);
            }
        }

        // Sort the new list by length
        Collections.sort(new_lst, Comparator.comparingInt(String::length));

        return new_lst;
    }
}

