                     100, 400, 500, 900, 1000}; 
        String[] sym = {"i", "iv", "v", "ix", "x", "xl",  
                        "l", "xc", "c", "cd", "d", "cm", "m"}; 
        int i = 12;
        StringBuilder res = new StringBuilder();

        while (number > 0) { 
            int div = number / num[i]; 
            number %= num[i]; 
            while (div > 0) { 
                res.append(sym[i]); 
                div--; 
            }
            i--; 
        }
        return res.toString();
    }
