class Solution {
    public String find_max(List<String> words) {
        return Collections.max(words, (a, b) -> {
            int uniqueA = (int) a.chars().distinct().count();
            int uniqueB = (int) b.chars().distinct().count();
            if (uniqueA != uniqueB) {
                return Integer.compare(uniqueA, uniqueB) * -1; // Sort by unique character count descending
            } else {
                return a.compareTo(b); // Sort lexicographically
            }
        });
    }
}

