class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        StringBuilder expression = new StringBuilder();
        expression.append(operand.get(0)); // Start with the first operand

        // Build the expression by appending operators and operands
        for (int i = 0; i < operator.size(); i++) {
            expression.append(" ").append(operator.get(i)).append(" ").append(operand.get(i + 1));
        }

        // Evaluate the expression
        return evaluateExpression(expression.toString());
    }

    private int evaluateExpression(String expression) {
        // Use a script engine to evaluate the expression
        try {
            // Create a script engine manager and get the JavaScript engine
            ScriptEngineManager manager = new ScriptEngineManager();
            ScriptEngine engine = manager.getEngineByName("JavaScript");
            // Evaluate the expression and return the result as an integer
            return (int) ((Number) engine.eval(expression)).doubleValue();
        } catch (Exception e) {
            e.printStackTrace();
            return 0; // Return 0 in case of an error
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.do_algebra(new ArrayList<>(Arrays.asList("**", "*", "+")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 37,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "*", "-")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 9,
                s.do_algebra(new ArrayList<>(Arrays.asList("/", "*")), new ArrayList<>(Arrays.asList(7, 3, 4))) == 8,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "**", "**")), new ArrayList<>(Arrays.asList(7, 5, 3, 2))) == 1953132
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

